import { NavigateTo } from "../Hooks/NavigateHook";

function Link({path, children})
{
   const handleClick = (event) =>
   {
       event.preventDefault();   //important line
       NavigateTo();
   }

   return <div>
       <a onClick={handleClick} href={path}>{children}</a>
   </div>
}

export default Link;
